import IconInfo from "./icons/info"
import { NavLink } from 'react-router-dom';
import React from 'react';

function Sidebar() {

  return (
    <nav className="flex overflow-hidden flex-col pt-32 text-sm font-semibold whitespace-nowrap bg-zinc-100 max-w-[259px] pb-[566px] text-neutral-400">
        <div className="flex overflow-hidden gap-2.5 items-center py-4 pr-12 pl-10 w-full">
                <IconInfo />
                <div className="self-stretch my-auto">README.md</div>
        </div>
    </nav>
  );

};

export default Sidebar;
